import React from "react";
import PageWrapper from "./components/PageWrapper";
import Login from "./components/Login";
import SignUp from "./components/SignUp";
import Home from "./components/Home";

function App() {
 
  return (
    <React.Fragment>
      <PageWrapper>
       <Login />
      </PageWrapper>

      <PageWrapper>
        <SignUp />
      </PageWrapper>

      <PageWrapper>
        <Home />
      </PageWrapper>

      <PageWrapper>
        <div className="justify-content-center">
            <h1>Profile Page</h1>
            <img className="my-3" src="https://cdn-icons-png.flaticon.com/512/1250/1250689.png" width={70} height={70}  alt="profile"/>
            <p>Full Name : Joe Mama</p>
            <p>Email : joemama@gmail.com</p>
            <p>Mobile : 225522552255</p>
            <label className="btn btn-dark"><input className="ms-3 joe" type="file"/>Choose a photo</label>
            <button className="btn btn-primary mx-2">Upload</button>
            <h4>Or</h4>
            <button className="btn btn-danger">Logout</button>
        </div>
      </PageWrapper>

    </React.Fragment>
  );
}

export default App;
